import Navebar from './navebar';

import Layout from './myLayout';

const About =() => (
     <div>
   <Navebar/>
    <h1>INFORMATION ABOUT AKUWEERA FOUNDATION</h1>
    <img src="/images/FB.jpg"/>
    <p>This foundation is based on helping children and the needy people providing for them basics like food,cloths, and housing like especially for thosse who do not have shelter</p>
    <p>They can be contacted from their registerd lines and they r located at mabirizi complex</p>
    <p>For any help to the children from any good samaritans , its welcome and Godwill award your abundantly</p>
     </div>
  );
export default About;
